import {
    ADD_NEW_TASK,
    DISPLAY_ANT_BOOL
} from './constants';

export const addNewTask = (form) => ({
    type: ADD_NEW_TASK,
    payload: form
})

export const displayANTBool = (bool) => ({
    type: DISPLAY_ANT_BOOL,
    payload: form
})
